<?php

define('APP_DB_HOST', cryptotask_get_option('app_db_host'));
define('APP_DB_USER', cryptotask_get_option('app_db_username'));
define('APP_DB_PASS', cryptotask_get_option('app_db_password'));
define('APP_DB_NAME', cryptotask_get_option('app_db_name'));

class AppDb
{
    private static $instance = null;

    private $db;

    private function __construct()
    {
        // Connect To Database
        try {
            $this->db = new wpdb(APP_DB_USER, APP_DB_PASS, APP_DB_NAME, APP_DB_HOST);
            $this->db->show_errors(); // Debug
        } catch (Exception $e) {    // Database Error
            echo $e->getMessage();
        }
    }

    public static function getInstance()
    {
        if (self::$instance == null) {
            self::$instance = new AppDb();
        }

        return self::$instance;
    }

    // Example Query -- Count Students
    public function get_featured_projects()
    {
        return $this->db->get_results("SELECT tasks.id, tasks.title, c2.name AS client_name, tasks.createdAt, tasks.duration, tasks.type, tasks.location
FROM tasks
LEFT JOIN clients c2 on tasks.postedBy = c2.id
WHERE tasks.deletedAt IS NULL AND tasks.featured = 1 AND tasks.status = 0
ORDER BY RAND()
LIMIT 4");
    }

    public function get_featured_freelancers()
    {
        $categories = explode('|', cryptotask_get_option('app_categories'));
        $data = [];

        foreach ($categories as $category) {
            $query = "select f1.id, f1.firstName, f1.lastName, f1.occupation, c3.name AS category, f.fileName
from freelancers f1
left join freelancerCategory C2 on f1.id = C2.freelancerId
left join categories c3 on C2.categoryId = c3.id
left join files f on f1.pictureId = f.id
where f1.featured = 1 AND c3.name = '$category' AND f1.published = 1
ORDER BY RAND()
LIMIT 6
";
            $rows = $this->db->get_results($query);
            $freelancers = [];

            foreach ($rows as $f) {
                if (!$freelancers[$f->id]) {
                    $freelancers[$f->id] = [
                        'id' => $f->id,
                        'name' => $f->firstName . ' ' . $f->lastName,
                        'picture' => $f->fileName ? $this->buildPictureUrl($f->fileName) : 'data:image/png;base64,',
                        'occupation' => $f->occupation,
                        'skills' => [],
                        'categories' => []
                    ];
                }

                if (!in_array($f->skill, $freelancers[$f->id]['skills'])) {
                    $freelancers[$f->id]['skills'][] = $f->skill;
                }

                if (!in_array($f->category, $freelancers[$f->id]['categories'])) {
                    $freelancers[$f->id]['categories'][] = $f->category;
                }
            }

            $data[$category] = $freelancers;
        }

        return $data;
    }

    private function buildPictureUrl($name) {
        $req = base64_encode(json_encode([
            'bucket' => 'cryptotask-public',
            'key' => $name,
        ]));

        return cryptotask_get_option('app_s3_url') . '/' . $req;
    }
}